  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0115257 includes chemical,
  meteorological, physical and underway - surface data collected from L'ASTROLABE
  in the Indian Ocean, South Pacific Ocean and Tasman Sea from 2012-01-07 to 2012-11-22
  and retrieved during cruise 353L20120107, 353L20120218 and 353L20121023. These data
  include AIR-SEA DIFFERENCE - PARTIAL PRESSURE (OR FUGACITY) OF CARBON DIOXIDE, BAROMETRIC
  PRESSURE, CARBON DIOXIDE - AIR, Partial pressure (or fugacity) of carbon dioxide,
  SALINITY, SEA SURFACE TEMPERATURE, WIND DIRECTION and WIND SPEED. The instruments
  used to collect these data include Carbon dioxide (CO2) gas analyzer and Shower
  head chamber equilibrator for autonomous carbon dioxide (CO2) measurement. These
  data were collected by Bronte Tilbrook of Commonwealth Scientific and Industrial
  Research Organization as part of the VOS_L_Astrolabe_2012_AL1112R2, VOS_L_Astrolabe_2012_AL1112R4
  and VOS_L_Astrolabe_2012_AL1213R0 data set.nnThe Global Volunteer Observing Ship
  (VOS) Program is coordinated by the UNESCO International Ocean Carbon Coordination
  Project (IOCCP). International groups from 14 countries have been outfitting research
  ships and commercial vessels with automated CO2 sampling equipment to analyze the
  carbon exchange between the ocean and atmosphere.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
